import React from 'react';

const MyShelf = () => {
    // Здесь можете добавить состояние и логику для работы с полкой (список книг, добавление и т.д.)

    return (
        <div className={"main-shelf"}>
            <h1>My Shelf</h1>
            <p>Here is your bookshelf content...</p>
        </div>
    );
};

export default MyShelf;
